import * as React from "react";
import { Box, Typography, AppBar, Toolbar, IconButton, Button } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import DateRangeIcon from "@mui/icons-material/DateRange";
import { Link } from "react-router-dom";

export default function NewPage() {
  const [selectedDate, setSelectedDate] = React.useState("January 22, 2025");

  const handleChangeDate = () => {
    // Logic to change the date (e.g., open a date picker)
    console.log("Change date clicked");
  };

  return (
    <>
      {/* AppBar */}
      <AppBar position="sticky" color="default" elevation={1} sx={{ paddingX: 4, backgroundColor: "#fff" }}>
        <Toolbar
          sx={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
          }}
        >
          {/* Logo */}
          <Box
            component={Link}
            to="/new"
            sx={{
              textDecoration: "none",
              display: "flex",
              alignItems: "center",
              gap: 1,
            }}
          >
            <Typography
              variant="h6"
              sx={{
                fontWeight: "bold",
                textTransform: "uppercase",
                color: "black",
              }}
            >
              Logo Placeholder
            </Typography>
          </Box>

          {/* Navigation Buttons */}
          <Box sx={{ display: "flex", alignItems: "center", gap: 3 }}>
            <Button component={Link} to="/venues" color="inherit">
              Venues
            </Button>
            <Button component={Link} to="/hair" color="inherit">
              Hair
            </Button>
            <Button component={Link} to="/makeup" color="inherit">
              Makeup
            </Button>
            <Button component={Link} to="/photographers" color="inherit">
              Photographers
            </Button>
            <Button component={Link} to="/music" color="inherit">
              Music
            </Button>
            <IconButton component={Link} to="/cart" color="inherit">
              <ShoppingCartIcon />
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>

      {/* Selected Date with Change Option */}
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          marginTop: 2,
        }}
      >
        <Typography variant="body1" fontWeight="bold">
          Selected Date: {selectedDate}
        </Typography>
        <Button
          startIcon={<DateRangeIcon />}
          sx={{ marginLeft: 1, textTransform: "capitalize" }}
          onClick={handleChangeDate}
        >
          Change
        </Button>
      </Box>

      {/* Listings */}
      <Box sx={{ padding: 4 }}>
        <Box sx={{ display: "flex", gap: 2, flexWrap: "wrap", justifyContent: "center" }}>
          {[1, 2, 3, 4, 5].map((item) => (
            <Box
              key={item}
              sx={{
                width: 300,
                backgroundColor: "#fff",
                padding: 2,
                borderRadius: 2,
                boxShadow: 1,
                textAlign: "center",
              }}
            >
              <Box
                sx={{
                  width: "100%",
                  height: 200,
                  backgroundColor: "#ccc",
                  borderRadius: 2,
                  marginBottom: 2,
                }}
              />
              <Typography variant="h6" fontWeight="bold">
                Example Listing {item}
              </Typography>
              <Typography variant="body2" color="textSecondary">
                City, State
              </Typography>
              <Box sx={{ display: "flex", justifyContent: "space-between", marginTop: 1 }}>
                <Typography variant="body2">â˜… 4.9</Typography>
                <Typography variant="body1" fontWeight="bold">
                  $300 / night
                </Typography>
              </Box>
            </Box>
          ))}
        </Box>
      </Box>
    </>
  );
}
